style.css:
@-moz-document domain("goatlings.com") {
body {
    background: #2c2c2c;
    color: #000;
}

#header, #sidebar > a, .search-top, .search-bot {
    display: none;
}
#content, b {
    color: #000 !IMPORTANT;
}
.search-mid {
    background: none;
}
.navlink {
    content:att r(alt);
    filter: grayscale(100%) brightness(60%) contrast(500%);
}
.navlink img {
    border-radius: 25px;
    padding-bottom: 3px;
}
#user-info-wrap img {
    filter: grayscale(100%) invert(100%) contrast(90%) brightness(300%);
}
#m, #n {
    border: 6px solid #2c2c2c !IMPORTANT;
    color: #000 !IMPORTANT;
}
#wrapper, h1, h2, h3 {
    background: #2c2c2c !IMPORTANT;
    color: #fff !IMPORTANT;
}
h1 {
    border-bottom: 10px solid #000 !IMPORTANT;
}
}
